import { useState } from "react"



function App(){
  const [count, setCount] = useState(0)

  const handleCount = () =>{
    setCount(count + 1)
  }
  return(
    <div>

      <h1>{count}</h1>
      <button onClick={handleCount}>+</button>
    </div>
  )
}

export default App
